import React from "react";

import Card from "./components/Card";
import Alert from './components/Alert';

function App() {
  return (
    <div className="container">

      <Card title="First Card Title" bgColor="red">
        <p>Aliquip dolore commodo nostrud minim. Cillum do enim non ullamco. Commodo magna eu ex
          mollit sunt amet fugiat. In irure eu enim id ea sit nostrud incididunt ad
          adipisicing.Aliquip dolore commodo nostrud minim. Cillum do enim non ullamco. Commodo
          magna eu ex mollit sunt amet fugiat. In irure eu enim id ea sit nostrud incididunt ad
          adipisicing.</p>
      </Card>


      <Card title="Second Card Title" bgColor="blue">
        <h1>Welcome</h1>
      </Card>

      <Alert type="danger">
        <Card title="Second Card Title">
          <h1>Welcome</h1>
        </Card>
      </Alert>

      <Alert type="success">This is success message</Alert>

      <Alert type="warning">This is warning message</Alert>

      <Alert>This is primary message</Alert>

    </div>
  );
}

export default App;
